import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import Bar from "./components/lawkers/bar";
import LawTimeSheet from "./components/lawkers/lawtimesheet.js";
import PayInvoice from "./components/lawkers/payinvoice";
import LawAdd from "./components/lawkers/lawAdd";
import TimeInput from "./components/lawkers/timeinput";
import * as serviceWorker from "./serviceWorker";

ReactDOM.render(
  <React.StrictMode>
    <Bar />
    <LawTimeSheet />
    <div>
      <PayInvoice />
    </div>
    <br />
    <br />
    <LawAdd />
    <br />
    <br />
    <TimeInput />
  </React.StrictMode>,
  document.getElementById("root")
);

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
